query:
mutation UpdateSeekerProfResumePortfolios($input: ProfResumeUpdatePortfoliosInput!) {
  updateSeekerProfResumePortfolios(input: $input) {
    errors {
      ... on ProfResumeDoesNotExist {
        message
        __typename
      }
      ... on ProfResumeDoesNotBelongToSeeker {
        message
        __typename
      }
      __typename
    }
    __typename
  }
}
